import React from 'react';


function Album(){
return (
    <Container>            
        <Form.Control type="search"
         placeholder="Search Songs/Artists"
         value={search}
         onChange = {e => setSearch(e.target.value)}/> 
            <div>
                <img 
                src={image}
                alt="new"
                />
            </div>          
    </Container>
)
}

export default Album;
